import React, {Component} from "react";
import './SearchBox.css'
class SearchBox extends Component{
    render(){
        return(
            <div>
                <input type='search' placeholder='search robots'></input>
                <button type="submit">Go</button>
            </div>    
        );
    }
}
export default SearchBox;
